import "./App.css";

const steps = [
  {
    id: "0",
    message: "Welcome To Claimbot",
    trigger: "1",
  },
];

function App() {
  return (
    <div className="App">
      <ChatBot steps={steps} />
    </div>
  );
}

export default App;
